SELECT MAX("title"."id") as agg_0, MAX("movie_companies"."id") as agg_1 FROM "title" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id"  WHERE "company_name"."name" NOT LIKE '%Home%' AND "movie_companies"."note" LIKE '%(Netherlands)%' AND "title"."title" NOT LIKE '%Pa%rt%' AND "movie_info_idx"."movie_id" <= 1485480 AND "movie_info_idx"."info_type_id" BETWEEN 100 AND 105;